import  axios  from "axios"

import {ADD,REMOVE,SEARCH,TEMPS,ORDER,ORDERW,FILTER} from "./Action-type"

export const AddDog = function (name){
    return (dispatch)=>{
    axios.get(`http://localhost:3001/getDogs/?name=${name}`)
  .then(({data}) =>{ console.log(data)
    return dispatch ({
    type: SEARCH,
    payload:data
  })

})

}
}

export const AddAllDogs = function (){
  return (dispatch)=>{
  axios.get(`http://localhost:3001/getAllDogs/`)
.then(({data}) =>{ console.log(data)
  return  dispatch({
  type: ADD,
  payload:data
})

})

}
}


export const getTemps = function (){
  return (dispatch)=>{
  axios.get(`http://localhost:3001/getTemp/`)
.then(({data}) =>{ console.log(data)
  return  dispatch({
  type: TEMPS,
  payload:data
})

})

}
}

export function filterDogs(Temperament) {
  return {
    type: FILTER,
    payload: Temperament
  }
}

export function OrderDog(order) {
  return {
    type: ORDER,
    payload: order
  }
}
export function OrderDogW(order) {
  return {
    type: ORDERW,
    payload: order
  }
}


const postDogObject = {
  id: 14,
  name: "1",
  life_span: "1",
  weight: { metric: "1- undefined" },
  height: { metric: "1- 1" },
  reference_image_id: "1",
  temperament: "1"
};


export const NewDog = function (postDogObject){
  axios.post('http://localhost:3001/postDog/', postDogObject)
  .then(response => {
    console.log("Solicitud POST exitosa:", response.data);
    // Puedes hacer algo más con la respuesta del servidor si es necesario
  })
  .catch(error => {
    console.error("Error al realizar la solicitud POST:", error);
    // Puedes manejar el error de alguna manera si es necesario
  });}
